  \"2015-11-25T17:32:29.006466\",\n\t\"name\": \"ease-grid-sea-ice-age\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This data set provides weekly estimates
  of sea ice age for the Arctic Ocean from remotely sensed sea ice motion and sea
  ice extent.  The ice age data are derived from a number of passive microwave imagers:
  the Scanning Multichannel Microwave Radiometer (SMMR), the Special Sensor Microwave/Imager
  (SSM/I), and the Special Sensor Microwave Imager Sounder (SSMIS). Visible and infrared
  data from the Advanced Very High Resolution Radiometer (AVHRR) were also utilized
  through 2004. In addition, International Arctic Buoy Program (IABP) drifting-buoy
  vectors and the National Centers for Environmental Prediction (NCEP)/National Center
  for Atmospheric Research (NCAR) Reanalysis Project (CDAS) are used to augment the
  satellite data. The data are on a sub-set of the Northern Hemisphere 12.5 km EASE-Grid.
  The data are in flat binary files and each has a corresponding browse GIF image
  for quick inspection of the data. Both are available via FTP.\",\n\t\"license_title\":
